'use strict'

var welcomeContainer = document.querySelector('.welcome');
var allCards = document.querySelectorAll('.welcome--card');
var activeIndex = 0;



allCards.forEach(function (card, index) {
  cardStyle(card, index);
});

function initCards(card, index) {
  var newCards = document.querySelectorAll('.welcome--card:not(.removed)');
  var oldCards = document.querySelectorAll('.welcome--card.removed');

  if(newCards.length == 0){
    setTimeout(function(){
      oldCards.forEach(function (card, index) {
        card.classList.remove('removed');
        cardStyle(card, index);
      });
    }, 1000);
  }else{
    newCards.forEach(function (card, index) {
      cardStyle(card, index);
    });
  }

  console.log("new : " + newCards.length)
  console.log("old : " + oldCards.length)

  
  welcomeContainer.classList.add('loaded');
}

function cardStyle(card, index){
  var transformStyle;

  if(index > 0){
    if(isEven(index)){
      transformStyle='scale(1) rotate(' + 3 * index + 'deg)';
    }else{
      transformStyle='scale(1) rotate(-' + 3 * index + 'deg)';
    }
  }else{
    transformStyle='scale(1) rotate(0deg)';
  }

  card.style.zIndex = allCards.length - index;
  card.style.transform = transformStyle;
  card.style.opacity = (10 - index) / 10;
  console.log(isEven(index));
}
function isEven(value){
  if (value%2 == 0)
      return true;
  else
      return false;
}

if ($('.welcome').length) {
  var sliderWelcome = new Swiper('.slider-welcome .swiper-container', {
    effect: "fade",
    allowTouchMove: false,
    slidesPerView: 1,
    navigation: {
      nextEl: '.slider-welcome .swiper-button-next',
      prevEl: '.slider-welcome .swiper-button-prev',
    },
    pagination: {
      el: '.slider-welcome .swiper-pagination',
      clickable: false,
      renderBullet: function (index, className) {
        return '<span class="' + className + '">' + (index + 1) + '</span>';
      },
    },
  });

  initCards();

  allCards.forEach(function (el, index) {
    var hammertime = new Hammer(el);
  
    hammertime.on('pan', function (event) {
      el.classList.add('moving');
    });
  
    hammertime.on('pan', function (event) {
      if (event.deltaX === 0) return;
      if (event.center.x === 0 && event.center.y === 0) return;
  
      var xMulti = event.deltaX * 0.03;
      var yMulti = event.deltaY / 80;
      var rotate = xMulti * yMulti;
  
      event.target.style.transform = 'translate(' + event.deltaX + 'px, ' + event.deltaY + 'px) rotate(' + rotate + 'deg)';
    });
  
    hammertime.on('panend', function (event) {
      el.classList.remove('moving');
  
      var moveOutWidth = document.body.clientWidth;
      var keep = Math.abs(event.deltaX) < 80 || Math.abs(event.velocityX) < 0.5;
  
      event.target.classList.toggle('removed', !keep);
  
      if (keep) {
        event.target.style.transform = '';
      } else {
        var endX = Math.max(Math.abs(event.velocityX) * moveOutWidth, moveOutWidth);
        var toX = event.deltaX > 0 ? endX : -endX;
        var endY = Math.abs(event.velocityY) * moveOutWidth;
        var toY = event.deltaY > 0 ? endY : -endY;
        var xMulti = event.deltaX * 0.03;
        var yMulti = event.deltaY / 80;
        var rotate = xMulti * yMulti;
  
        event.target.style.transform = 'translate(' + toX + 'px, ' + (toY + event.deltaY) + 'px) rotate(' + rotate + 'deg)';

        initCards();
        
      }
    });
  });
}


$(window).on('load', function () {
  $('.preloader').addClass('preloader--hide');
  $('body').addClass('body-show');

  if ($('.welcome').length) {
    sliderWelcome.autoplay.start();
  }
});